		/// <summary>
		/// Create a hw_device (jtag chain) on an open target
		///
		///
		/// TCL Syntax: create_hw_device [-idcode <arg>] [-irlength <arg>] [-mask <arg>] [-part <arg>] [-quiet] [-verbose]
