		/// get_pins * -filter {DIRECTION == IN && NAME !~ "*RESET*"}
		/// Boolean (bool) type properties can be directly evaluated in filter expressions as true or not true:
		/// -filter {IS_PRIMITIVE && !IS_LOC_FIXED}
