		/// <summary>
		/// Run SSN analysis on the current package and pinout
		///
		///
		/// TCL Syntax: report_ssn [-name <arg>] [-return_string] [-format <arg>] [-file <arg>] [-append] [-phase] [-quiet] [-verbose]
