		/// set_property PROGRAM.BPI_RS_PINS {none} $cfgMem
		/// set_property PROGRAM.CFG_PROGRAM 1 $cfgMem
		/// set_property PROGRAM.CHECKSUM 0 $cfgMem
		/// set_property PROGRAM.ERASE 1 $cfgMem
